Company Operations
Distribution. We operate multiple distribution and fulfillment centers worldwide to support our Retail, Wholesale and Nuuly segments in the United States, Europe and Canada.
Retail Segment
Our Retail segment distribution and fulfillment centers receive and distribute our retail store merchandise and fulfill catalog, website and mobile application orders around the world. The primary Retail segment facilities that support our North America Retail segment operations are:
•1,000,000 square foot omni-channel fulfillment center we own in Gap, Pennsylvania;
•291,000 square foot distribution center we own in Gap, Pennsylvania;
•956,000 square foot fulfillment center we own in Indiana, Pennsylvania;
•880,000 square foot omni-channel fulfillment center we own in Kansas City, Kansas;
•463,000 square foot fulfillment center we own in Reno, Nevada; and
•214,500 square foot distribution center we lease in Reno, Nevada To support North America Retail segment customer demand until the omni-channel fulfillment center in Kansas City, Kansas was operational, we leased a 401,000 square foot fulfillment center located in Kansas City, Missouri. The lease commenced in fiscal 2022 and expired in fiscal 2024.

